row.EN-Gloss:
a group of chiefly woody plants considered among the most primitive of angiosperms; perianth poorly developed or lacking; flowers often
    unisexual and often in catkins and often wind pollinated; contains 23 families including the Betulaceae and Fagaceae (includes the Amentiferae);
    sometimes classified as a superorder

the act of taking revenge (harming someone in retaliation for something harmful that they have done) especially in the next life;
    "Vengeance is mine; I will repay, saith the Lord"--Romans 12:19; "For vengeance I would do nothing. This nation is too great to look for mere
    revenge"--James Garfield; "he swore vengeance on the man who betrayed him"; "the swiftness of divine retribution"
